script: |
  super -f text -I q11267.spq | sort > q11267.out

inputs:
  - name: q11267.spq
    data: |
      SELECT CAST ( NULL AS INTEGER ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( col1 * CAST ( col1 / - col2 AS INTEGER ) + - col0 * - 74 ) BETWEEN + ( + col0 ) AND - col2;
  - name: tab1

outputs:
  - name: q11267.out
    data: |
